import React, { Component } from 'react';

class NavbarTwo extends Component {
  render() {
    return (
      <div>
        <nav class="navbar navbar-expand-lg navbar-light bg-light">
          <div class="container">
            <a class="navbar-brand" href="#">
              Navbar
            </a>
          </div>
        </nav>
      </div>
    );
  }
}

export default NavbarTwo;
